description:
En saga och utopi.
Kriget ar slut och Tyskland har vunnit. Alla europas lander ingar i Germania och 
Berlin ar huvudstad. Allt ar frid och Hitlers 75 arsdag skall firas da det intraffar ett mord. Och en SS-major far upp ett spar till vad var det egentligen som hande osterut under kriget.....
Med bl.a: Rutger Hauer, Miranda Richarson och Peter Vaughan

OBS. DET FINNS INGA UNDERTEXTER.

Talade spraket ar engelska.		
